import './App.css';

function App() {
    return (
        <div>
            <div className="App"><Header/></div>
            <div>Hello world!</div>
        </div>);
}

const Header = () =>{
    return (
        <div>
            <ul class="navbar">
                <li class="nav-item active" ><a class="naw-link" href="#">My bowls</a></li>
                <li class="nav-item"><a class="nav-link" href="">Create</a></li>
            </ul>
            <form class="search">
                <input class="search-btn" id="search_btn" type="text" placeholder="Search"></input>
                <button class="btn btn-search" id="search_btn">Search</button>
                <button class="btn btn-clear" id="search_clear">Clear</button>
            </form>
        </div>
    );
}
